import React from "react";
import Header from "../../components/Header/Header";
import Footer from "../../components/Footer/Footer";

const DEFAULT_CENTER = { lat: 31.5, lng: 34.75 }; // Israel

export default function LeaderboardPage() {
  const [query, setQuery] = React.useState("");
  const apiKey = process.env.REACT_APP_GOOGLE_MAPS_API_KEY || "";
  const mapRef = React.useRef(null);     // div למפה
  const mapObjRef = React.useRef(null);  // נשמור את אובייקט המפה

  // טוען את סקריפט גוגל פעם אחת ומאתחל מפה
  React.useEffect(() => {
    if (!apiKey) {
      console.error("Missing Google Maps API key (REACT_APP_GOOGLE_MAPS_API_KEY)");
      return;
    }

    const existing = document.querySelector('script[data-qq="maps"]');
    if (existing && window.google?.maps) {
      initMap(); // כבר נטען בעבר
      return;
    }

    const script = document.createElement("script");
    script.src = `https://maps.googleapis.com/maps/api/js?key=${apiKey}`;
    script.async = true;
    script.defer = true;
    script.dataset.qq = "maps";
    script.onload = () => {
      console.debug("Google Maps JS loaded");
      initMap();
    };
    script.onerror = (e) => console.error("Failed to load Google Maps script", e);
    document.head.appendChild(script);

    return () => {
      // לא מסירים את הסקריפט – שלא ייטען פעמיים בין ניווטים
    };
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [apiKey]);

  function initMap() {
    if (!mapRef.current) return;
    // צור מפה רק פעם אחת
    if (!mapObjRef.current) {
      mapObjRef.current = new window.google.maps.Map(mapRef.current, {
        center: DEFAULT_CENTER,
        zoom: 7,
        // אפשר להשאיר UI דיפולטי כדי לראות בבירור שהמפה עלתה
      });
      // מרקר דמו: תל־אביב
      new window.google.maps.Marker({
        position: { lat: 32.0853, lng: 34.7818 },
        map: mapObjRef.current,
      });
      console.debug("Map initialized");
    }
  }

  // סגנון inline בלבד — בלי CSS חיצוני
  const styles = {
    layout: { display: "flex", gap: 24, padding: 24, alignItems: "stretch" },
    left: { flex: 1 },
    right: { width: 380, minWidth: 280 },
    card: {
      background: "#fff",
      borderRadius: 16,
      boxShadow: "0 8px 20px rgba(0,0,0,.06)",
      padding: 16,
      height: "100%",
      display: "flex",
      flexDirection: "column",
    },
    title: { margin: "0 0 12px", fontSize: 20, fontWeight: 700, textAlign: "center" },
    mapBox: {
      height: "70vh",       // **חובה** – גובה מפורש
      borderRadius: 12,
      overflow: "hidden",
    },
    input: {
      width: "100%",
      padding: "10px 12px",
      borderRadius: 8,
      border: "1px solid #e4e6eb",
      outline: "none",
      marginBottom: 12,
    },
    placeholder: {
      height: "70vh",
      border: "1px dashed #cfd4db",
      borderRadius: 8,
      display: "grid",
      placeItems: "center",
      color: "#7a8699",
    },
  };

  return (
    <>
      <Header />
      <main style={styles.layout}>
        {/* Map (left) */}
        <section style={styles.left}>
          <div style={styles.card}>
            <h2 style={styles.title}>Map</h2>
            {apiKey ? (
              <div style={styles.mapBox} ref={mapRef} />
            ) : (
              <div style={styles.placeholder}>
                Missing Google Maps API key (set <code>REACT_APP_GOOGLE_MAPS_API_KEY</code> in <code>client/.env</code>)
              </div>
            )}
          </div>
        </section>

        {/* List (right) */}
        <aside style={styles.right}>
          <div style={styles.card}>
            <h2 style={styles.title}>Leaderboard</h2>
            <input
              type="text"
              placeholder="Search school…"
              value={query}
              onChange={(e) => setQuery(e.target.value)}
              style={styles.input}
            />
            <div style={styles.placeholder}>List goes here</div>
          </div>
        </aside>
      </main>
      <Footer />
    </>
  );
}
